import React from 'react';
import classes from './App.css';
import {Route, Switch} from "react-router-dom"
import CardHolder from "./Pages/cardHolder/cardHolder";
import Auth from "./Pages/Auth/Auth";
import CallBoard from "./Pages/CallBoard/CallBoard";
import Notes from "./Pages/Notes/Notes";


function App() {
    return (
        <div className={classes.App}>
            <Switch>
                <Route exect={"true"} path="/auth" component={Auth}/>
                <Route exect={"true"} path="/callboard" component={CallBoard}/>
                <Route exect={"true"} path="/notes" component={Notes}/>
                <Route exect={"true"} path="/" component={CardHolder}/>
            </Switch>
        </div>

    );
}

export default App;
